// 1.\u5220\u9664\u7684\u662F\u53F6\u5B50\u7ED3\u70B9
if (current.left === null && current.right === null) {
  // 1.1 \u5220\u9664\u7684\u662F\u6839\u8282\u70B9
  if (current === this.root) {
    this.root = null;
  } else if (isLeftChild) {
    parent.left = null;
  } else {
    parent.right = null;
  }
}
