  `,paraId:3},{value:`// 2.\u65B9\u4FBF\u6D4B\u8BD5\uFF0C\u5148\u5B8C\u6210toString\u65B9\u6CD5
LinkedList.prototype.toString = function () {
  var current = this.head;
  var resultString = '';
  while (current) {
    resultString += current.data + ' ';
    current = current.next;
  }
  return resultString;
};
