`,paraId:4,tocIndex:2},{value:"34.\u5728\u6392\u5E8F\u6570\u7EC4\u4E2D\u67E5\u627E\u5143\u7D20\u7684\u7B2C\u4E00\u4E2A\u548C\u6700\u540E\u4E00\u4E2A\u4F4D\u7F6E",paraId:0},{value:"medium",paraId:5,tocIndex:2},{value:"\u8DDF",paraId:6,tocIndex:3},{value:"\u5251\u6307 Offer 53 - I. \u5728\u6392\u5E8F\u6570\u7EC4\u4E2D\u67E5\u627E\u6570\u5B57 I",paraId:7,tocIndex:3},{value:"\u76F8\u4F3C",paraId:6,tocIndex:3},{value:`/**
 * @param {number[]} nums
 * @param {number} target
 * @return {number[]}
 */
var searchRange = function (nums, target) {
  if (nums.length === 0) return [-1, -1];
  return [leftSearch(nums, target), rightSearch(nums, target)];
};

var leftSearch = (nums, target) => {
  let left = 0,
    right = nums.length - 1;
  while (left <= right) {
    let mid = left + Math.floor((right - left) / 2);
    if (nums[mid] < target) {
      left = mid + 1;
    } else if (nums[mid] > target) {
      // \u641C\u7D22\u533A\u95F4\u53D8\u4E3A [left, mid-1]
      right = mid - 1;
    } else if (nums[mid] === target) {
      // \u641C\u7D22\u533A\u95F4\u53D8\u4E3A [left, mid-1]
      right = mid - 1; //\u6CE8\u610F
    }
  }

  // left \u662F\u7684\u533A\u95F4\u662F[0,nums.length]
  // if (left === nums.length) return -1; // \u8D8A\u754C
  return nums[left] === target ? left : -1;
};

var rightSearch = (nums, target) => {
  let left = 0,
    right = nums.length - 1;

  while (left <= right) {
    let mid = left + Math.floor((right - left) / 2);
    if (nums[mid] < target) {
      left = mid + 1;
    } else if (nums[mid] > target) {
      right = mid - 1;
    } else if (nums[mid] === target) {
      left = mid + 1; //\u6CE8\u610F
    }
  }

  // if (left - 1 < 0) return -1;// \u9632\u6B62\u8D8A\u754C
  // return nums[left - 1] === target ? right : -1;
  // \u5F53while\u7ED3\u675F\u65F6\uFF0Cleft-1=right;
  // if (right < 0) return -1;// \u9632\u6B62\u8D8A\u754C
  return nums[right] === target ? right : -1;
};
`,paraId:8,tocIndex:3},{value:"154.\u5BFB\u627E\u65CB\u8F6C\u6392\u5E8F\u6570\u7EC4\u4E2D\u7684\u6700\u5C0F\u503C-ii",paraId:0},{value:"hard",paraId:9,tocIndex:3},{value:"\u4E8C\u5206\u6CD5\u5BFB\u627E\u6700\u5C0F\u503C",paraId:10,tocIndex:4},{value:`/**
 * @param {number[]} nums
 * @return {number}
 */
// \u4E8C\u5206\u6CD5\u5BFB\u627E\u6700\u5C0F\u503C
var findMin = function (nums) {
  let n = nums.length;
  if (n === 1) return nums[0];
  // \u539F\uFF1A[0,1,2,2,2,2,3,4,5,6]
  // \u540E\uFF1A[2,3,4,5,6,0,1,2,2,2]
  // [2,3,4,5,6,0,1,2,2,2]
  //  l       m    >    r  ==> l=m+1;
  // [2,3,4,5,6,0,1,2,2,2]
  //            l   m = r  ==> r=r-1;
  // [2,3,4,5,6,0,1,2,2,2]
  //            l m < r  ==> r=m;
  // [2,3,4,5,6,0,1,2,2,2]
  //            l
  //            m<r  ==> r = m;
  // \u6700\u540El=r;\u505C\u6B62\u5BFB\u627E

  let left = 0,
    right = n - 1;
  while (left < right) {
    // let mid = Math.floor((left + right) / 2);
    let mid = (left + right) >> 1;
    console.log(left, mid, right);
    if (nums[mid] > nums[right]) {
      left = mid + 1;
    } else if (nums[mid] < nums[right]) {
      right = mid;
    } else if (nums[mid] === nums[right]) {
      right = right - 1;
    }
  }

  return nums[right];
};
`,paraId:11,tocIndex:4},{value:"278.\u7B2C\u4E00\u4E2A\u9519\u8BEF\u7684\u7248\u672C",paraId:0},{value:"easy",paraId:12,tocIndex:4},{value:`/**
 * Definition for isBadVersion()
 *
 * @param {integer} version number
 * @return {boolean} whether the version is bad
 * isBadVersion = function(version) {
 *     ...
 * };
 */

/**
 * @param {function} isBadVersion()
 * @return {function}
 */
var solution = function (isBadVersion) {
  /**
   * @param {integer} n Total versions
   * @return {integer} The first bad version
   */
  return function (n) {
    let l = 1,
      r = n;
    while (l < r) {
      const mid = Math.floor(l + (r - l) / 2);
      if (isBadVersion(mid)) {
        // \u7ED3\u679C\u5728[l,mid]
        r = mid;
      } else {
        l = mid + 1; // \u7ED3\u679C\u5728[mid+1,r]
      }
    }
    // \u6B64\u65F6l=r,\u8FD4\u56DE\u5176\u4E2D\u4E00\u4E2A\u70B9\u5373\u53EF
    return l;
  };
};
