`,paraId:3,tocIndex:1},{value:"\u5DE6\uFF1A",paraId:4,tocIndex:1},{value:"\uFF08index * 2\uFF09+1",paraId:4,tocIndex:1},{value:"\u53F3\uFF1A\u5DE6+1 ",paraId:4,tocIndex:1},{value:"\uFF08index * 2\uFF09+2",paraId:4,tocIndex:1},{value:`// \u6784\u5EFA\u6700\u5C0F\u5806
class MinHeap {
  constructor() {
    this.heap = [];
  }

  getParentIndex(index) {
    // return Math.floor((index - 1) / 2);
    return (index - 1) >> 1;
  }

  getLeftIndex(index) {
    return index * 2 + 1;
  }

  getRightIndex(index) {
    return this.getLeftIndex(index) + 1;
  }

  swap(i, j) {
    [this.heap[j], this.heap[i]] = [this.heap[i], this.heap[j]];
  }

  insert(val) {
    this.heap.push(val);
    this.shiftUp(this.heap.length - 1);
  }

  shiftUp(index) {
    if (index === 0) return;
    const parentIndex = this.getParentIndex(index);
    if (this.heap[index] < this.heap[parentIndex]) {
      this.swap(index, parentIndex);
      this.shiftUp(parentIndex);
    }
  }

  pop() {
    const last = this.heap.pop();
    // \u82E5heap\u53EA\u6709\u4E00\u4E2A\u5143\u7D20\uFF0C\u76F4\u63A5pop\u5373\u53EF
    if (this.heap.length !== 0) {
      // \u82E5heap\u8FD8\u6709\u5185\u5BB9
      this.heap[0] = last; // \u4F7F\u7528last\u5143\u7D20\u76F4\u63A5\u66FF\u6362\u6389heap[0]\u76F8\u5F53\u4E8E\u5220\u9664
      this.shiftDown(0);
    }
  }

  shiftDown(index) {
    const leftIndex = this.getLeftIndex(index);
    const rightIndex = this.getRightIndex(index);
    if (this.heap[index] > this.heap[leftIndex]) {
      this.swap(index, leftIndex);
      this.shiftDown(leftIndex);
    }

    if (this.heap[index] > this.heap[rightIndex]) {
      this.swap(index, rightIndex);
      this.shiftDown(rightIndex);
    }
  }

  peek() {
    return this.heap[0];
  }

  size() {
    return this.heap.length;
  }
}
/**
 * @param {number} k
 * @param {number[]} nums
 */
// \u53EF\u4EE5\u7406\u89E3\u4E3A\u627E\u51FA\u4E16\u754C\u4E0A\u7B2Ck\u5389\u5BB3\u7684\u4EBA
var KthLargest = function (k, nums) {
  this.k = k;
  this.minHeap = new MinHeap();

  for (const item of nums) {
    this.minHeap.insert(item); // \u63D2\u5165\u5143\u7D20\uFF0C\u6700\u5C0F\u5806\u5185\u4F1A\u6392\u5E8F
    if (this.minHeap.size() > this.k) {
      // \u5806\u5185\u5143\u7D20\u591A\u4E8Ek
      this.minHeap.pop(); // \u5C06\u6700\u5C0F\u7684\u5143\u7D20\u79FB\u9664
    }
  }
};

/**
 * @param {number} val
 * @return {number}
 */
KthLargest.prototype.add = function (val) {
  this.minHeap.insert(val);
  if (this.minHeap.size() > this.k) {
    this.minHeap.pop();
  }
  return this.minHeap.peek();
};
